import "./App.css";
import Home from "./components/Home";
import Register from "./components/Register";
import Login from "./components/Login";
import React from "react";
import {
  BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";


function App() {
  const user = true;
  return (
    <div className="App">
     <Router>
     <Switch>
     <Route path="/login">
            <Login />
          </Route>
          <Route path="/register">
            <Register />
          </Route>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/movies">
            <Home type="movies" />
          </Route>
          <Route path="/series">
            <Home type="series" />
          </Route>


        </Switch>
        </Router>

    </div>
  );
}

export default App;
